package day_3_23;

public class Relational_operator {
// <,>,==,<=,>=
	public static void main(String[] args) {
		// TODO Auto-generated method stub
         int a=10;
         int b=20;
         int c=30;
         int d=30;
         
         System.out.println(a>b);
         System.out.println(c>b);
         System.out.println(a<b);
         System.out.println(b==d);
         System.out.println(d>=c);
	}

}
